function pL(){Ha({title:"Blueprint help",Da:!0}).content.a.innerHTML='Blueprints allow planting a whole field layout at once, and storing layouts<br/><br/>A field layout represents a crop type for each tile. Crop types are for example berry, mushroom, flower, nettle, ... A layout never refers to a specific crop, such as blackberry or blueberry, only to the type (here "berry") in general.<br/><br/>Planting a blueprint places crop templates on the field. You can also plant individual crop templates yourself using the regular plant dialog.<br/><br/>The blueprint will only plant templates on empty field cells, when a field cell already has something (including another template) it is not overplanted.<br/><br/>If the blueprint and field have a different size, it still just works and plants anything it can that is not out of bounds, centered around the tree. The tree is not present in the blueprint itself, it assumes where the standard position of a field of that size is.<br/><br/>To create a blueprint, you can use two methods:<br/> \u2022 From field: the current field layout is copied to the blueprint, e.g. wherever there\'s any berry on the field, produces a berry template in the blueprint.<br/> \u2022 From text (TXT): Write a field layout on multiple lines of text using letter symbols (B for berry, ...). Export TXT does the opposite.<br/><br/>Keyboard shotcuts for blueprints:<br/>Note: on mac, ctrl means command instead.<br/> \u2022 "b": open the blueprint dialog (from field, or from ethereal field)<br/> \u2022 shift + click blueprint in main blueprint dialog: plant it immediately, and overriding existing field crops, rather than opening its editing dialog (if not empty)<br/> \u2022 "t", "b": open transcend dialog, and then open transcend-with-blueprint dialog<br/> \u2022 "1-9" in blueprint selection dialog: shortcuts to open or use this blueprint<br/> \u2022 "shift 1-9" in blueprint selection dialog: override field with this blueprint (shift key not necessary in transcend-with-blueprint dialog)<br/> \u2022 "f" in blueprint editing dialog: set blueprint from fuild<br/> \u2022 "Enter" in blueprint editing dialog: override field with blueprint<br/> \u2022 "u": when mouse hovering over blueprint template: upgrade template to highest crop tier you can afford of that type<br/><br/>Once automaton is advanced enough, it can also use blueprints.'}
